import logo from './logo.svg';
import './App.css';
import { Landing } from "./Components/Landing";
import { Provider } from "react-redux";
import { configStore } from "./Components/state/configStore";

function App() {
  const mystore = configStore();
  return (
    <Provider store={mystore}>
      <div className="App">
        <Landing />
      </div>
      //{" "}
    </Provider>
  );
}

export default App;
